import React from "react";

const TableHead = () => {
  return (
    <thead>
    <tr>
      <th scope="col">Brand</th>
      <th scope="col">year</th>
      <th scope="col">Fuel type</th>
      <th scope="col">Fee</th>
    </tr>
  </thead>
  );
};

export default TableHead;
